import React from 'react';
import { Link, NavLink, withRouter } from 'react-router-dom'

const Navbar = (props) => {
  // console.log(props)
  
  // setTimeout(()=>{
  //   props.history.push('/');
  // },5000);
  return (
    <nav className="nav-wrapper red darken-3">
      <div className="container">
        <Link className="brand-logo" to="/">Poke' Times</Link>
        <ul className="right">
          <li><NavLink exact to="/">Home</NavLink></li>
          <li><NavLink to='/about'>About</NavLink></li>
          <li><NavLink to='/contact'>Contact</NavLink></li>
        </ul>
      </div>
    </nav> 
  )
}

export default withRouter(Navbar)

//          Higher order component withRouter
// following history.push method is available in Navbar component only because of higher
  // order component ie withRouter. Otherwise it was only available in Route component
  // if you see this Navbar component in App.js file Navbar is not in <Route tag
